const GetGameData = (data) => {
    console.log(data);
    const instance = data.g;
    console.log(instance);


    const GameData = {
        'date': instance.gdte,
        'time': instance.utctm,
        'city': instance.ac,
        'state': instance.as,
        // 'opponent': opponent,
        'status': instance.st
    };
    return GameData;
}

export default GetGameData;
